import {useState,useEffect} from 'react';
import axios from "axios";


export default function (){
    const [itemList, setItemList] = useState([]);


    useEffect(()=>{
        axios.get("/items")
            .then(res =>{
                setItemList(res.data);
            })

    },[])


    return(
        <div>itemList LIST
            {itemList.map(i=>{
                return <div>
                    item name: {i.name} ||
                    price : {i.price} ||
                    stock quantity : {i.stockQuantity} ||
                    author : {i.author} ||
                    isbn : {i.isbn}
                </div>
            })}


        </div>

    )


}
